import { useRouter } from 'next/router';

/**
 *
 * @param context
 * @param target
 */
const redirect = (context, target) => {
  const router = useRouter();
  if (context.res) {
    context.res.writeHead(303, { location: target });
    context.res.end();
  } else {
    Router.replace(target);
  }
};

export default () => {
  return redirect({}, '/home');
};
